import React from 'react'

const Footer=()=>{


        return (
            <div class="wpo-footer-area undefined"><div class="container">
            <div class="wpo-footer-top"><div class="row">
            <div class="col-lg-2 col-md-3 col-sm-3 col-12">
            <div class="footer-logo"></div></div><div class="col-lg-6 col-md-9 col-sm-9 col-12">
              <NavLink to="#">Portfolio</NavLink>
              <div class="wpo-footer-menu"><ul><li><a href="/about">About</a></li>
              <li><a href="/protfolio">Portfolio</a></li><li><a href="/blog">Blog</a></li>
              <li><a href="/contact">Contact</a></li></ul></div></div>
              <div class="col-lg-4 col-md-12 col-sm-12 col-12">
                <div class="wpo-footer-social">
                  <ul><li><a href="/">
                    <i class="fa fa-facebook"></i></a></li>
                    <li><a href="/"><i class="fa fa-twitter" aria-hidden="true"></i></a></li>
                    <li><a href="/"><i class="fa fa-instagram" aria-hidden="true"></i>
            </a></li></ul></div></div></div></div></div><div class="wpo-footer-bottom undefined"><span>© 2021 portfolio. All rights reserved</span></div></div>
        );
    };

export default Footer;
